        // Hilfsfunktionen
        function normalizeStreetName(name) {
            return name ? name.toLowerCase().trim() : '';
        }

        function parseHousenumber(hnr) {
            const match = String(hnr).match(/(\d+)/);
            return match ? parseInt(match[1]) : null;
        }

        function isInRange(housenr, ranges) {
            const num = parseHousenumber(housenr);
            if (num === null) return false;

            for (const [min, max, parity] of ranges) {
                if (num < min || num > max) continue;
                
                if (parity === 'odd' && num % 2 === 0) continue;
                if (parity === 'even' && num % 2 === 1) continue;
                
                return true;
            }
            return false;
        }

        function findWahlbezirk(streetName, housenumber) {
            const normalized = normalizeStreetName(streetName);
            
            for (const [bezirk, streetsData] of Object.entries(wahlbezirkeData)) {
                if (normalized in streetsData) {
                    const ranges = streetsData[normalized];
                    
                    if (housenumber && ranges.length > 0) {
                        if (isInRange(housenumber, ranges)) {
                            return bezirk;
                        }
                    } else if (!housenumber) {
                        return bezirk;
                    }
                }
            }
            return null;
        }

        // Style-Funktionen
        function getColorForFeature(feature) {
            const props = feature.properties;
            let bezirk = null;
            
            // Geb√§ude mit Hausnummer
            if (props['addr:housenumber'] && props['addr:street']) {
                bezirk = findWahlbezirk(props['addr:street'], props['addr:housenumber']);
            }
            
            // Stra√üe
            if (!bezirk && props.highway && props.name) {
                bezirk = findWahlbezirk(props.name, null);
            }
            
            if (bezirk && stimmenanteile[bezirk]) {
                return getColorByPercentage(stimmenanteile[bezirk]);
            }
            
            return '#cccccc'; // Grau f√ºr unzugeordnet
        }

        function styleStreet(feature) {
            return {
                color: getColorForFeature(feature),
                weight: 3,
                opacity: 0.7
            };
        }

        function styleBuilding(feature) {
            return {
                fillColor: getColorForFeature(feature),
                fillOpacity: 0.6,
                color: '#333',
                weight: 1,
                opacity: 0.8
            };
        }

        // Filter Features
        function filterFeature(feature) {
            const showStreets = document.getElementById('showStreets').checked;
            const showBuildings = document.getElementById('showBuildings').checked;
            
            if (feature.properties.highway && !showStreets) return false;
            if (feature.properties.building && !showBuildings) return false;
            
            return true;
        }

        // Event Handlers
        function highlightFeature(e) {
            const layer = e.target;
            const feature = layer.feature;
            
            if (feature.properties.highway) {
                layer.setStyle({ weight: 5, opacity: 1 });
            } else {
                layer.setStyle({ fillOpacity: 0.9, weight: 2 });
            }
        }

        function resetHighlight(e) {
            geojsonLayer.resetStyle(e.target);
        }

        function onFeatureClick(e) {
            const feature = e.target.feature;
            const props = feature.properties;
            
            let info = '';
            let bezirk = null;
            
            if (props['addr:street'] && props['addr:housenumber']) {
                const street = props['addr:street'];
                const hnr = props['addr:housenumber'];
                bezirk = findWahlbezirk(street, hnr);
                
                info += `<strong>${street} ${hnr}</strong><br>`;
            } else if (props.highway && props.name) {
                bezirk = findWahlbezirk(props.name, null);
                info += `<strong>${props.name}</strong><br>`;
                info += `<span style="font-size: 11px; color: #666;">Typ: ${props.highway}</span><br>`;
            }
            
            if (bezirk) {
                const anteil = stimmenanteile[bezirk];
                info += `<div style="margin-top: 8px; padding: 8px; background: #f0f0f0; border-radius: 3px;">`;
                info += `Wahlbezirk: <strong>${bezirk}</strong><br>`;
                info += `Gr√ºnen-Stimmenanteil: <span class="percentage">${(anteil * 100).toFixed(1)}%</span>`;
                info += `</div>`;
            } else {
                info += '<span style="color: #999;">Kein Wahlbezirk zugeordnet</span>';
            }
            
            document.getElementById('selected-info').innerHTML = info;
        }

        function onEachFeature(feature, layer) {
            layer.on({
                mouseover: highlightFeature,
                mouseout: resetHighlight,
                click: onFeatureClick
            });
        }

        // GeoJSON Layer
        let geojsonLayer = L.geoJSON(geojsonData, {
            style: function(feature) {
                if (feature.properties.highway) {
                    return styleStreet(feature);
                } else {
                    return styleBuilding(feature);
                }
            },
            filter: filterFeature,
            onEachFeature: onEachFeature
        }).addTo(map);

        // Filter Event Listeners
        document.getElementById('showStreets').addEventListener('change', updateMap);
        document.getElementById('showBuildings').addEventListener('change', updateMap);

        function updateMap() {
            map.removeLayer(geojsonLayer);
            geojsonLayer = L.geoJSON(geojsonData, {
                style: function(feature) {
                    if (feature.properties.highway) {
                        return styleStreet(feature);
                    } else {
                        return styleBuilding(feature);
                    }
                },
                filter: filterFeature,
                onEachFeature: onEachFeature
            }).addTo(map);
        }

        // Legende erstellen
        const legendContent = document.getElementById('legend-content');
        
        // Variable f√ºr aktuell ausgew√§hlten Wahlbezirk
        let selectedBezirk = null;
        
        // Sortiere Wahlbezirke nach Stimmenanteil
        const sortedBezirke = Object.keys(stimmenanteile).sort((a, b) => {
            return stimmenanteile[b] - stimmenanteile[a]; // Absteigend
        });
        
        sortedBezirke.forEach(bezirk => {
            const anteil = stimmenanteile[bezirk];
            const color = getColorByPercentage(anteil);
            
            const item = document.createElement('div');
            item.className = 'legend-item';
            item.setAttribute('data-bezirk', bezirk);
            item.innerHTML = `
                <div class="legend-color" style="background-color: ${color}"></div>
                <span>WB ${bezirk}: ${(anteil * 100).toFixed(1)}%</span>
            `;
            
            // Click-Event f√ºr Hervorhebung
            item.addEventListener('click', function() {
                const clickedBezirk = this.getAttribute('data-bezirk');
                
                // Toggle selection
                if (selectedBezirk === clickedBezirk) {
                    // Deselektieren
                    selectedBezirk = null;
                    this.classList.remove('selected');
                    resetAllHighlights();
                } else {
                    // Neuen Bezirk selektieren
                    // Entferne vorherige Selektion
                    document.querySelectorAll('.legend-item').forEach(el => {
                        el.classList.remove('selected');
                    });
                    
                    selectedBezirk = clickedBezirk;
                    this.classList.add('selected');
                    highlightBezirk(clickedBezirk);
                }
            });
            
            legendContent.appendChild(item);
        });
        
        // Funktion zum Hervorheben eines Wahlbezirks
        function highlightBezirk(bezirk) {
            // Erst alle Styles zur√ºcksetzen
            geojsonLayer.eachLayer(function(layer) {
                geojsonLayer.resetStyle(layer);
            });
            
            // Dann neuen Bezirk hervorheben
            geojsonLayer.eachLayer(function(layer) {
                const feature = layer.feature;
                const props = feature.properties;
                
                let featureBezirk = null;
                
                // Bestimme Wahlbezirk des Features
                if (props['addr:housenumber'] && props['addr:street']) {
                    featureBezirk = findWahlbezirk(props['addr:street'], props['addr:housenumber']);
                } else if (props.highway && props.name) {
                    featureBezirk = findWahlbezirk(props.name, null);
                }
                
                if (featureBezirk === bezirk) {
                    // Hervorheben
                    if (props.highway) {
                        layer.setStyle({
                            weight: 6,
                            opacity: 1,
                            color: '#CD7F32' // Bronze
                        });
                    } else {
                        layer.setStyle({
                            fillOpacity: 0.95,
                            weight: 3,
                            color: '#CD7F32' // Bronze
                        });
                    }
                    layer.bringToFront();
                } else {
                    // Ausgrauen
                    if (props.highway) {
                        layer.setStyle({
                            opacity: 0.2
                        });
                    } else {
                        layer.setStyle({
                            fillOpacity: 0.15,
                            opacity: 0.2
                        });
                    }
                }
            });
            
            // Zoom auf den Wahlbezirk
            const bezirkLayers = [];
            geojsonLayer.eachLayer(function(layer) {
                const feature = layer.feature;
                const props = feature.properties;
                
                let featureBezirk = null;
                if (props['addr:housenumber'] && props['addr:street']) {
                    featureBezirk = findWahlbezirk(props['addr:street'], props['addr:housenumber']);
                } else if (props.highway && props.name) {
                    featureBezirk = findWahlbezirk(props.name, null);
                }
                
                if (featureBezirk === bezirk) {
                    bezirkLayers.push(layer);
                }
            });
            
            if (bezirkLayers.length > 0) {
                const group = L.featureGroup(bezirkLayers);
                map.fitBounds(group.getBounds(), { padding: [50, 50] });
            }
        }
        
        // Funktion zum Zur√ºcksetzen aller Hervorhebungen
        function resetAllHighlights() {
            geojsonLayer.eachLayer(function(layer) {
                geojsonLayer.resetStyle(layer);
            });
            map.fitBounds(geojsonLayer.getBounds());
        }

        // Zoom auf Daten
        map.fitBounds(geojsonLayer.getBounds());
    </script>
</body>
</html>
